■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>1日の肌疲れを癒しながら洗うクレンジングクリーム。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5401/1062197-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【使用方法】<br>手のひらにさくらんぼ粒くらい(約3g)をとり、顔の5か所(額、両ほほ、鼻、あご)におきます。指先でらせんを描くようにして肌にのばし、クリームをすべらせるようにメイクアップ料やよごれと充分なじませます。その後、ティッシュペーパーで肌を強くこすらないように注意してふきとるか、水またはぬるま湯で洗い流します。<br><br>【使用上の注意】<br>※傷やはれもの、湿疹等の異常がある部分にはお使いにならないでください。<br>※化粧品がお肌に合わないとき、即ち次の場合にはご使用をおやめください。<br>(1)使用中、赤味・はれ・かゆみ・刺激等の異常があらわれた場合。<br>(2)使用したお肌に直射日光があたって上記のような症状があらわれた場合。<br>そのまま使用を続けますと症状を悪化させることがありますので、専門医へのご相談をお勧めします。<br><br>【保管方法】<br>※極端に高温又は低温の場所や、直射日光のあたる場所には保管しないでください。<br>※浴室内におかないでください。<br>※乳幼児の手の届かない所に保管してください。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">天然ミネラルクレイ配合。まろやかなタッチで肌を包み込みながら、メイクや毛穴の汚れ、余分な皮脂を溶かしだししっかり落とします。さらにトリートメント効果で肌のうるおいを保ちながらみずみずしく透明感の溢れる肌に導きます。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">天然ミネラルクレイ配合。まろやかなタッチで肌を包み込みながら、メイクや毛穴の汚れ、余分な皮脂を溶かしだししっかり落とします。さらにトリートメント効果で肌のうるおいを保ちながらみずみずしく透明感の溢れる肌に導きます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">120g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：4×5×14cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：300g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：化粧品</font><br><font color="#333333" size="-1">メーカー名：エーエフシー</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">水、スクワラン、ネオペンタン酸イソデシル、エチルヘキサン酸セチル、トリエチルヘキサノイン、ステアリン酸ポリグリセリル-10、BG、グリセリン、ベヘニルアルコール、ステアリン酸グリセリル、ジメチコン、ジステアリン酸ポリグリセリル-2、イライト、ステアロイルグルタミン酸Na、アラントイン、グリチルレチン酸ステアリル、プラセンタエキス、サッカロミセス溶解質エキス、ダイズ芽エキス、ヒアルロン酸Na、アセチルヒアルロン酸Na、水溶性プロテオグリカン、グリセリルグルコシド、ビフィズス菌発酵エキス、キサンタンガム、トコフェロール、カワラヨモギ花エキス、チョウジエキス、カプリル酸グリセリル、フェノキシエタノール、香料</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
